### Summary of Core Topics, Concepts, Principles, and Equations

#### Linear Transformations
- **Definition**: A linear transformation \( T: \mathbb{R}^n \to \mathbb{R}^m \) is a function that preserves vector addition and scalar multiplication.
- **Matrix Representation**: Any linear transformation can be represented by a matrix \( A \) such that \( T(x) = Ax \).
- **Injective (One-to-One)**: A transformation is injective if \( T(x) = T(y) \) implies \( x = y \).
- **Surjective (Onto)**: A transformation is surjective if for every \( y \in \mathbb{R}^m \), there exists an \( x \in \mathbb{R}^n \) such that \( T(x) = y \).
- **Bijective**: A transformation is bijective if it is both injective and surjective.
- **Rank and Nullity**: For a matrix \( A \), rank is the dimension of the column space, and nullity is the dimension of the null space. The Rank-Nullity Theorem states that \( \text{rank}(A) + \text{nullity}(A) = n \).

#### Important Equations
- **Linear Transformation**: \( T(x) = Ax \)
- **Rank-Nullity Theorem**: \( \text{rank}(A) + \text{nullity}(A) = n \)
- **Projection Matrix**: For a projection onto a subspace \( W \), \( P_W \) is the projection matrix.

#### Orthonormal Basis and Gram-Schmidt Process
- **Orthonormal Basis**: A set of vectors \( \{u_1, u_2, \ldots, u_n\} \) is orthonormal if each vector is a unit vector and they are mutually orthogonal.
- **Gram-Schmidt Process**: A method for orthonormalizing a set of vectors in an inner product space.

#### Affine Subspaces
- **Definition**: An affine subspace is a translation of a vector subspace. It is defined as \( v + W \), where \( v \) is a vector and \( W \) is a subspace.
- **Solution Set**: The solution set of \( Ax = b \) is an affine subspace if \( b \) is in the column space of \( A \).

